    [],nt"revision_timestamp": "2016-07-27T22:56:00.572378",nt"name": "bowdoin-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Bowdoin
    National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses management planning and research
    and investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, grasslands, other habitats, grazing,
    fire management, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, other migratory birds, game mammals, other resident
    wildlife, scientific collections, marking and bird banding, and disease prevention
    and control. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, hunting, wildlife observation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment utilization, communications
    systems, and computer systems. Cooperative programs, other economic uses, and items
    of interest are provided at the end. A brief report on Bowdoin Wetland Management
    District is provided. Photographs are attached.",nt"license_title": "License
